import './Navbar.css';
import { Link } from 'react-router-dom';

function Navbar() {
  return(
    <div className="navbar">
        <div className="btn">
            <Link to="/">
                <img className="logo" src="webshio.png" alt=""/>
            </Link>
        <div className="cart">
            <Link to="cart">
                <img src="cart.svg" alt=""/>
            </Link>
        </div>
        </div>
        </div>

  );
}

// alumine tehke ise

export default Navbar;
